import React from 'react';
import '../../Header.css';
import bars from '../../../../img/bars-solid.svg';

class Menu extends React.Component{
    constructor(props){
      super();
    }

    render(){
        return  <div className="header__navBar">
                    <button><img src={bars} alt="fa-bars" /></button>
                </div>  
    } 
}

export default Menu;
